import React, { useState, useEffect } from 'react';
import { 
  FiUsers, 
  FiHome, 
  FiDollarSign,
  FiCheckSquare,
  FiActivity,
  FiBarChart2,
  FiPlus,
  FiTrendingUp,
  FiHeart,
  FiCalendar,
  FiArrowUp,
  FiArrowDown,
  FiStar,
  FiPackage,
  FiRefreshCw,
  FiSend
} from 'react-icons/fi';
import axios from 'axios';
import { LineChart, Line, BarChart, Bar, PieChart, Pie, Cell, AreaChart, Area, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import '../styles/DashboardOverview.css'; // Make sure this import is correct

function DashboardOverview() {
  // State for statistics
  const [stats, setStats] = useState({
    users: { total: 0, trend: 0 },
    properties: { total: 0, trend: 0 },
    revenue: { total: 0, trend: 0 },
    likes: { total: 0, trend: 0 }
  });
  
  // State for charts data
  const [chartData, setChartData] = useState({
    propertiesByType: [],
    propertiesByStatus: [],
    revenueOverTime: [], // This will still use mock data
    userActivity: []     // This will still use mock data
  });
  
  // State for recent activity
  const [recentActivity, setRecentActivity] = useState([]);
  
  // State for loading and error status
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  
  // Fetch dashboard data
  useEffect(() => {
    const fetchDashboardData = async () => {
      setLoading(true);
      setError(null);
      
      try {
        // Fetch real data from the backend
        const response = await axios.get('http://localhost/real_estate_project/api/dashboard_stats.php', {
          withCredentials: true
        });
        
        console.log('API Response:', response.data); // Debug log
        
        const data = response.data;
        
        if (data.success) {
          // Set stats from API response
          setStats({
            users: data.stats.users || { total: 0, trend: 0 },
            properties: data.stats.properties || { total: 0, trend: 0 },
            revenue: data.stats.revenue || { total: 0, trend: 0 },
            likes: data.stats.likes || { total: 0, trend: 0 }
          });
          
          // Format property type data for the pie chart
          const typeData = data.propertyByType.map(item => ({
            name: item.name || 'Unknown',
            value: item.count || 0
          }));
          
          // Format property status data for the bar chart
          const statusData = data.propertyByStatus.map(item => ({
            name: item.name || 'Unknown',
            value: item.count || 0
          }));
          
          setChartData({
            propertiesByType: typeData,
            propertiesByStatus: statusData,
            revenueOverTime: generateMonthlyData(), // Still using mock data for this chart
            userActivity: generateWeeklyData()      // Still using mock data for this chart
          });
          
          // Format recent activity data with icons
          const activityWithIcons = data.recentActivity.map(activity => {
            // Map action types to icons
            const getIcon = (action) => {
              if (action.includes('registered')) return FiUsers;
              if (action.includes('listed')) return FiHome;
              if (action.includes('liked')) return FiHeart;
              if (action.includes('purchase') || action.includes('sold')) return FiDollarSign;
              if (action.includes('review')) return FiCheckSquare;
              return FiActivity;
            };
            
            return {
              ...activity,
              icon: getIcon(activity.action)
            };
          });
          
          setRecentActivity(activityWithIcons);
        } else {
          throw new Error(data.message || 'Failed to fetch dashboard data');
        }
      } catch (err) {
        console.error('Error fetching dashboard data:', err);
        setError('Failed to load dashboard data. Please try again later.');
      } finally {
        setLoading(false);
      }
    };
    
    fetchDashboardData();
  }, []);
  
  // Function to generate monthly revenue data for the line chart (still mock data)
  const generateMonthlyData = () => {
    const months = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'];
    return months.map(month => ({
      name: month,
      revenue: Math.floor(Math.random() * 20000) + 8000,
      properties: Math.floor(Math.random() * 50) + 10
    }));
  };
  
  // Function to generate weekly user activity data (still mock data)
  const generateWeeklyData = () => {
    const days = ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'];
    return days.map(day => ({
      name: day,
      views: Math.floor(Math.random() * 150) + 50,
      likes: Math.floor(Math.random() * 50) + 5,
      inquiries: Math.floor(Math.random() * 20) + 1
    }));
  };
  
  // Format large numbers
  const formatNumber = (num) => {
    if (!num) return '$0';
    
    if (num >= 1000000) {
      return `$${(num / 1000000).toFixed(1)}M`;
    } else if (num >= 1000) {
      return `$${(num / 1000).toFixed(0)}K`;
    }
    return `$${Number(num).toLocaleString()}`;
  };
  
  // Custom colors for charts
  const COLORS = ['#e63946', '#457b9d', '#1d3557', '#f1faee', '#a8dadc'];
  const STATUS_COLORS = {
    'Available': '#4caf50',
    'Pending': '#ff9800',
    'Sold': '#2196f3'
  };
  
  return (
    <>
      <section id="dashboard" className="dashboard-section">
        <div className="section-header">
          <h2 className="section-title">
            <FiBarChart2 className="section-icon" />
            Dashboard Overview
          </h2>
          <p className="section-subtitle">Key performance metrics and insights</p>
        </div>
        
        {loading ? (
          <div className="loading-spinner">Loading dashboard data...</div>
        ) : error ? (
          <div className="error-message">{error}</div>
        ) : (
          <>
            <div className="stats-grid">
              <div className="stat-card">
                <div className="stat-icon"><FiUsers /></div>
                <div className="stat-value">{stats.users.total.toLocaleString()}</div>
                <div className="stat-label">Total Users</div>
                <div className={`stat-trend ${stats.users.trend >= 0 ? 'positive' : 'negative'}`}>
                  {stats.users.trend >= 0 ? '↑' : '↓'} {Math.abs(stats.users.trend)}%
                </div>
              </div>
              <div className="stat-card">
                <div className="stat-icon"><FiHome /></div>
                <div className="stat-value">{stats.properties.total.toLocaleString()}</div>
                <div className="stat-label">Properties</div>
                <div className={`stat-trend ${stats.properties.trend >= 0 ? 'positive' : 'negative'}`}>
                  {stats.properties.trend >= 0 ? '↑' : '↓'} {Math.abs(stats.properties.trend)}%
                </div>
              </div>
              <div className="stat-card">
                <div className="stat-icon"><FiDollarSign /></div>
                <div className="stat-value">{formatNumber(stats.revenue.total)}</div>
                <div className="stat-label">Revenue</div>
                <div className={`stat-trend ${stats.revenue.trend >= 0 ? 'positive' : 'negative'}`}>
                  {stats.revenue.trend >= 0 ? '↑' : '↓'} {Math.abs(stats.revenue.trend)}%
                </div>
              </div>
              <div className="stat-card">
                <div className="stat-icon"><FiHeart /></div>
                <div className="stat-value">{stats.likes.total.toLocaleString()}</div>
                <div className="stat-label">Total Likes</div>
                <div className={`stat-trend ${stats.likes.trend >= 0 ? 'positive' : 'negative'}`}>
                  {stats.likes.trend >= 0 ? '↑' : '↓'} {Math.abs(stats.likes.trend)}%
                </div>
              </div>
            </div>
            
            {/* Charts Grid */}
            <div className="charts-grid">
              {/* Properties by Type Distribution */}
              <div className="chart-card">
                <h3 className="chart-title">Properties by Type</h3>
                <div className="chart-container">
                  {chartData.propertiesByType.length > 0 ? (
                    <ResponsiveContainer width="100%" height={250}>
                      <PieChart>
                        <Pie
                          data={chartData.propertiesByType}
                          cx="50%"
                          cy="50%"
                          labelLine={false}
                          outerRadius={80}
                          fill="#8884d8"
                          dataKey="value"
                          label={({ name, percent }) => `${name || 'Unknown'} ${(percent * 100).toFixed(0)}%`}
                        >
                          {chartData.propertiesByType.map((entry, index) => (
                            <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                          ))}
                        </Pie>
                        <Tooltip formatter={(value) => [`${value} properties`, 'Count']} />
                        <Legend />
                      </PieChart>
                    </ResponsiveContainer>
                  ) : (
                    <div className="no-data-message">No property type data available</div>
                  )}
                </div>
              </div>
              
              {/* Properties by Status */}
              <div className="chart-card">
                <h3 className="chart-title">Properties by Status</h3>
                <div className="chart-container">
                  {chartData.propertiesByStatus.length > 0 ? (
                    <ResponsiveContainer width="100%" height={250}>
                      <BarChart data={chartData.propertiesByStatus}>
                        <CartesianGrid strokeDasharray="3 3" />
                        <XAxis dataKey="name" />
                        <YAxis />
                        <Tooltip formatter={(value) => [`${value} properties`, 'Count']} />
                        <Legend />
                        <Bar dataKey="value" name="Properties">
                          {chartData.propertiesByStatus.map((entry, index) => (
                            <Cell key={`cell-${index}`} fill={STATUS_COLORS[entry.name] || COLORS[index % COLORS.length]} />
                          ))}
                        </Bar>
                      </BarChart>
                    </ResponsiveContainer>
                  ) : (
                    <div className="no-data-message">No property status data available</div>
                  )}
                </div>
              </div>
              
              {/* Revenue Over Time (still using mock data) */}
              <div className="chart-card">
                <h3 className="chart-title">Revenue Trends</h3>
                <div className="chart-container">
                  <ResponsiveContainer width="100%" height={250}>
                    <AreaChart data={chartData.revenueOverTime}>
                      <CartesianGrid strokeDasharray="3 3" />
                      <XAxis dataKey="name" />
                      <YAxis yAxisId="left" orientation="left" stroke="#e63946" />
                      <YAxis yAxisId="right" orientation="right" stroke="#457b9d" />
                      <Tooltip formatter={(value, name) => [name === 'revenue' ? formatNumber(value) : value, name === 'revenue' ? 'Revenue' : 'Properties']} />
                      <Legend />
                      <Area type="monotone" dataKey="revenue" name="Revenue" yAxisId="left" stroke="#e63946" fill="#e63946" fillOpacity={0.3} />
                      <Line type="monotone" dataKey="properties" name="Properties" yAxisId="right" stroke="#457b9d" strokeWidth={2} />
                    </AreaChart>
                  </ResponsiveContainer>
                </div>
              </div>
              
              {/* User Activity (still using mock data) */}
              <div className="chart-card">
                <h3 className="chart-title">Weekly User Activity</h3>
                <div className="chart-container">
                  <ResponsiveContainer width="100%" height={250}>
                    <BarChart data={chartData.userActivity} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
                      <CartesianGrid strokeDasharray="3 3" />
                      <XAxis dataKey="name" />
                      <YAxis />
                      <Tooltip />
                      <Legend />
                      <Bar dataKey="views" name="Views" stackId="a" fill="#8884d8" />
                      <Bar dataKey="likes" name="Likes" stackId="a" fill="#e63946" />
                      <Bar dataKey="inquiries" name="Inquiries" stackId="a" fill="#82ca9d" />
                    </BarChart>
                  </ResponsiveContainer>
                </div>
              </div>
            </div>
            
            <div className="content-grid">
              {/* Recent Activity Section */}
              <section id="recent-activity" className="dashboard-section">
                <div className="section-header">
                  <h2 className="section-title">
                    <FiActivity className="section-icon" />
                    Recent Activity
                  </h2>
                  <p className="section-subtitle">Latest user actions and system events</p>
                </div>
                <div className="activity-list">
                  {recentActivity.length > 0 ? (
                    recentActivity.map((activity, index) => (
                      <div className="activity-item" key={index}>
                        <div className="activity-icon">
                          <activity.icon />
                        </div>
                        <div className="activity-content">
                          <p className="activity-text"><strong>{activity.user}</strong> {activity.action}</p>
                          <p className="activity-time">{activity.time}</p>
                        </div>
                      </div>
                    ))
                  ) : (
                    <div className="no-activity">No recent activity to display</div>
                  )}
                </div>
              </section>

              {/* Quick Actions Section */}
              <section id="quick-actions" className="dashboard-section">
                <div className="section-header">
                  <h2 className="section-title">
                    <FiPackage className="section-icon" />
                    Quick Actions
                  </h2>
                  <p className="section-subtitle">Common administrative tasks</p>
                </div>
                <div className="actions-grid">
                  <button 
                    className="quick-action"
                    onClick={() => document.querySelector('a[href="#properties"]').click()}
                  >
                    <FiPlus className="action-icon" />
                    <span className="action-text">Add Property</span>
                  </button>
                  <button 
                    className="quick-action"
                    onClick={() => document.querySelector('a[href="#users"]').click()}
                  >
                    <FiUsers className="action-icon" />
                    <span className="action-text">Manage Users</span>
                  </button>
                  <button className="quick-action">
                    <FiSend className="action-icon" />
                    <span className="action-text">Send Newsletter</span>
                  </button>
                  <button className="quick-action">
                    <FiBarChart2 className="action-icon" />
                    <span className="action-text">Generate Report</span>
                  </button>
                  <button 
                    className="quick-action"
                    onClick={() => window.location.reload()}
                  >
                    <FiRefreshCw className="action-icon" />
                    <span className="action-text">Refresh Dashboard</span>
                  </button>
                  <button className="quick-action">
                    <FiCalendar className="action-icon" />
                    <span className="action-text">Scheduled Tasks</span>
                  </button>
                </div>
              </section>
            </div>
          </>
        )}
      </section>
    </>
  );
}

export default DashboardOverview;
